      #rotatePhone {
        display:none;
        z-index: 10;
        margin-top:100px;
        width:50%;
        position:fixed;
        pointer-events: none;
        -webkit-animation:pulse 4s infinite;
        animation:pulse 4s infinite;
      }

        @keyframes pulse{
            30%{-webkit-transform: rotate(0deg)}
            70%{-webkit-transform: rotate(-90deg)}
            95%{-webkit-transform: rotate(-90deg)}
            100%{-webkit-transform: rotate(0deg)}
        }

        @-webkit-keyframes pulse{
            30%{-webkit-transform: rotate(0deg)}
            70%{-webkit-transform: rotate(-90deg)}
            95%{-webkit-transform: rotate(-90deg)}
            100%{-webkit-transform: rotate(0deg)}
        }


      .center {
        width:50%;
        margin-left:auto;
        margin-right:auto;        
      }

      .icon {
        background-color: rgba(0,0,0,.2);
        border-style: solid;
        border-color: rgba(255,255,255,.5);
        border-width: 2px;
        border-radius: 24px;
        position: absolute; 
        cursor:pointer;
        display: block; 
        width: 40px; 
        height: 40px; 
        background-size: cover;
        -webkit-user-select: none; 
        transition: transform 0.15s;
        -moz-transition: -moz-transform 0.15s;
        -webkit-transition: -webkit-transform 0.15s;
        -webkit-tap-highlight-color: #1ff;
      }

      .icon:hover {
        transform: scale(1.25);
        -webkit-transform: scale(1.25);
      }

      #icon_webvr {
        width:64px;
        height:64px;
      }
      #icon_exitfull {
        display:none;
      }
      #icon_webvr {
        display:none;
      }
      #zoom-icon {
        right: 80px;
        bottom: 25px;
      }

      #webvr-container {
        left: 0; 
        right: 0;
        margin-left: auto; 
        margin-right: auto;
        bottom: 25px;         
      }

      #info-icon {
        right: 20px;
        bottom: 1px;
      }


    p {
       font-family: "HelveticaNeue-Light", "Helvetica Neue Light", "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif; 
       font-weight: 300;
       font-size: 11px;
       margin-left: 15px;
    }      

      .fadeup {
          transition-duration: 0.25s;
          transition-property: transform opacity;
          outline: 0;
          opacity: 0;
          pointer-events: none;
      }

      .fadeup:focus img {
        transform: translate(0,-15px);
        -webkit-transform: translate(0,-15px);          
      }

      .fadeup img {
          transition-duration: 0.5s;
          transform: translate(0,75px);
          -webkit-transform: translate(0,75px);          
          transition-property: transform opacity;
      }

      .fadeup:focus {
        opacity: 1.0;
        transform: translate(0,-40px);
        -webkit-transform: translate(0,-40px);
        pointer-events: auto;
      }


      @media only screen and (orientation: landscape) and (min-device-width: 1200px) {
          #webvr-container {
            bottom: 20px; 
          }

          #info-icon {
            bottom: 25px;
          }

          #zoom-icon {
            right: 90px; 
          }
      }

    </style>

  <script id="vs" type="notjs">
    attribute vec4 a_position;
    uniform vec4 u_color;
    varying vec4 v_color;
    varying vec2 v_position;

    void main() {
      v_color = u_color;
      v_position = a_position.xy;
      gl_Position = a_position;
    }
  </script>


  <script id="fs" type="notjs">
    precision mediump float;
    uniform samplerCube u_skybox;
    uniform mat4 u_viewDirectionProjectionInverse;
    varying vec2 v_position;
    varying vec4 v_color;
    uniform vec3 u_distortion;

    // original src: http://rifty-business.blogspot.com/2013/08/understanding-oculus-rift-distortion.html
    // typical u_distortion values: https://github.com/ValveSoftware/steamworks-vr-api/issues/4#issuecomment-34941206
    float distortionScale(vec2 offset) {
        vec2 offsetSquared = offset * offset;
        float radiusSquared = offsetSquared.x + offsetSquared.y;
        float distortionScale = //
                u_distortion[0] + u_distortion[1] * radiusSquared + //
                u_distortion[2] * radiusSquared * radiusSquared;
        return distortionScale;
    } 

    void main() {
      vec2 p = v_position;
      if (u_distortion[0] > 0.0) p *= distortionScale(v_position);
      vec4 t = u_viewDirectionProjectionInverse * vec4(p, 1, 1);
      gl_FragColor =  textureCube( u_skybox, normalize(vec3(-t.x, t.yz) / t.w)) * v_color;
    }
  </script>

    var vrHMD, vrSensor, vrEnabled = false;

    function initVR(callbackfn) {
        function enumerateVRDevices(vrdevs) {
            // First, find a HMD -- just use the first one we find
            vrdevs.every(function(e) {
                vrHMD = e;
                return (!e instanceof HMDVRDevice)
            })
            if (!vrHMD) return;
            if (callbackfn) callbackfn();

            // Then, find that HMD's position sensor
            vrdevs.every(function(e) {
                getCameraQuaternion = function() {
                    var quat = [0, 0, 0, 0];
                    if (vrSensor) {
                        var state = vrSensor.getState();
                        if (state.orientation)
                            quat = [state.orientation.x, state.orientation.y, state.orientation.z, state.orientation.w];
                    }
                    return quat;
                }
                vrSensor = e;
                return !((e.hardwareUnitId == vrHMD.hardwareUnitId) && (e instanceof PositionSensorVRDevice))
            })
        }
        if (navigator.getVRDevices)
            navigator.getVRDevices().then(enumerateVRDevices);
        else if (navigator.mozGetVRDevices)
            navigator.mozGetVRDevices(enumerateVRDevices);
    }

    initVR(function(){
      setSvgIcon(1);
    });

    function startVRfullscreen() {
      if (!vrHMD) 
        console.log("couldn't find webVR. Opening to full screen, and displaying the info card on how to support Oculus by installing webVR.");

    if (isMobile)
      isDistortion = (isDistortion) ? 0 : 1;

    if (isMobile || vrEnabled)
      isStereo = (isStereo) ? null:1;
      if (document.webkitIsFullScreen || document.mozFullScreen || document.msFullscreenElement) {
        if (document.msExitFullscreen) document.msExitFullscreen();
        if (document.webkitIsFullScreen) document.webkitExitFullscreen();
        if (document.mozFullScreen) document.mozCancelFullScreen();
      }
      else { 
          var t = { vrDisplay: vrHMD /*,vrDistortion: false */ }
          if (document.body.webkitRequestFullScreen) document.body.webkitRequestFullScreen(t)
          if (document.body.mozRequestFullScreen) document.body.mozRequestFullScreen(t)
          if (document.body.msRequestFullscreen) document.body.msRequestFullscreen()
      }
    }
    function fullScreenChange() {
      var isFullscreen = (document.webkitIsFullScreen || document.mozFullScreen || document.msFullscreenEnabled);
        vrEnabled = vrHMD && isFullscreen;
        //automatically switch to stereo mode if 'cardboard' or is 'webVR' enabled
        //update icon's
        if (!vrHMD) {
          setSvgIcon((isFullscreen) ? 2:0);
      }

        var programInfo = twgl.createProgramInfo(gl, ["vs", "fs"]);
        var plane = twgl.primitives.createXYQuadBufferInfo(gl);

        var previewTxture = twgl.createTexture(gl, {

                u_distortion: [1.0,0.05,0.07] // cardboard v1 [1.0,0.15,0.18] // SVR Glass [1.0,0.08,0.09]
            }
            drawObjects.push({
                programInfo: programInfo,
                bufferInfo: plane,
                uniforms: uniforms,
            });

            objects.push({
                skyboxL: previewTxture,
                skyboxR: previewTxture,
                fov: 90,
                uniforms: uniforms,
                type: 0
            });
